<h2>Elk &#8211; &#8222;Ratownicy Zycia&#8221;</h2>
<div class="the_post">
<h3>W sobote 24 wrzesnia 2016 przy Parku Wodnym w Elku mozna bylo oddac swoja krew.</h3>
<h3>  W tegorocznym wydarzeniu wziely udzial sluzby, na co dzien zajmujace sie ratowaniem zdrowia i zycia ludzi.</h3>
<h3>Nasza fundacja rowniez wlaczyla sie w akcje.</h3>
<h3>Przygotowalismy krotka prelekcje dot: przywilejow  dla Zasluzonych Honorowych Dawcow Krwi w aptece /recepty z ZK / , wolontariusze rozdawali naklejki z &#8222;<b> Tabela Zgodnosci Grup Krwi"</b> sponsorowane przez Spoldzielnie Socjalna-,, Mixgraf- Studio Reklamy".</h3>
<h3>Nasza fundacja,  Mazurskie Ochotnicze Pogotowie Ratownicze / MOPR/ i 15 Gizycka Brygada Zmechanizowana - razem reprezentowalismy powiat gizycki.</h3>
<h3>Dziekujemy za zaproszenie organizatorowi Panu B.Cieslukowskiemu  - / Wodne Ochotnicze Pogotowie Ratunkowe w Elku/, ze moglismy brac udzial w tak prestizowym wydarzeniu, cennym dla zdrowia i zycia.</h3>

