<h2>&#8221; Kocham wolny styl, kocham sny, kocham zycie &#8221; / cyt; Zeus</h2>
<div class="the_post">
<h3>&#8221; Kocham wolny styl, kocham sny, kocham zycie &#8221; / cyt; Zeus/</h3>
<h3>to jedno z hasel projektu w zakresie edukacji i promocji zdrowia publicznego realizowanego przez Mazurska Fundacje Mlodziezy Niepelnosprawnej ,,Marzenia" w czasie wakacji na terenie woj . warminsko- mazurskiego , w powiecie gizyckim, elckim i oleckim.<br />
Na tablicach edukacyjnych zostaly umieszczone:<br />
- hasla bezposrednio nawiazujace do profilaktyki HIV,<br />
- hasla propagujace ,, czysty" powrot z koncertu do domu,<br />
- pozytywne cytaty znanych artystow, idoli mlodziezy z utworow HIP - HOP afirmujacych zycie, uczucia, milosc.<br />
Jakie ?????"<br />
Zapraszamy w Elku &#8211; na ulice Mickiewicza i Armii Krajowej,<br />
w Wydminach &#8211; na ulice Grunwaldzka,<br />
Celem Kampanii Zdrowotnej ,,Wroc bez HIV" ,&#8221; Wakacyjna taktyka &#8211; to profilaktyka&#8221; jest uswiadomienie, jakie ryzyko niosa ze soba nieprzemyslane sytuacje,ktore moga sie przytrafic mlodym uczestnikom imprez masowych w czasie wakacji, podczas koncertow,<br />
- edukacja i profilaktyka chorob przenoszonych droga plciowa w tym zakazen HIV, skierowana do mlodych ludzi uczestniczacych w imprezach masowych, takich jak festiwale muzyczne, a takze dyskoteki i kluby nocne.<br />
Zapraszamy &#8211; mlodziez, rodzicow, opiekunow, uczestnikow wakacyjnych imprez i festynow do wlaczenia sie w kampanie, ktorej celem jest ograniczenie liczby zakazen HIV, zwiekszenie swiadomosci dotyczacej konsekwencji podejmowania ryzykownych zachowan.<br />
Obecnie projekt jest realizowany w Elku -pt. &#8221; Wroc bez HIV&#8221;<br />
i w Gminie Wydminy &#8211; pt.&#8221; Wakacyjna taktyka &#8211; to profilaktyka&#8221;.</h3>
<div>
<h3>Zadanie sfinansowano ze srodkow Samorzadu Wojewodztwa Warminsko &#8211; Mazurskiego , budzetu Miasta Elku &#8222;.<br />
Urzedu Gminy Wydminy, Gminnej Komisji Rozwiazywania Problemow Alkoholowych w Wydminach , realizowane w partnerstwie ze Spoldzielnia Socjalna "Mixgraf&#8221;- Studio Reklamy &#8222;.</h3>

