<h2>Questing w Wydminach - pt. ,,Uroki Wydmin" - relacja.</h2>
<div class="the_post">
<h3>W sobote 04.06.2016 z inicjatywy Mazurskiej Fundacji Mlodziezy Niepelnosprawnej " Marzenia"zostalo zrealizowane zadanie z zakresu:</h3>
<h3>-  ekologii i ochrony zwierzat oraz ochrony dziedzictwa przyrodniczego.</h3>
<h3>Celem zadania jest:<br />
-promocja walorow przyrodniczo - historycznych Gminy Wydminy,<br />
-podniesienie atrakcyjnosci turystycznej Gminy Wydminy,<br />
-zachecanie dzieci, mlodziezy i mieszkancow Gminy Wydminy do spedzania czasu w kontakcie z przyroda,<br />
-integracja miedzypokoleniowa, spoleczna i rodzinna mieszkancow Gminy Wydminy.<br />
Zadania wpisuje sie w cele statutowe fundacji, szeroko pojeta rehabilitacje spoleczna dzieci i mlodziezy niepelnosprawnej.<br />
Wolontariuszki z Wydmin rozdawaly ulotki z opisem trasy i pamiatkowe eko-breloczki zachecajac do wspolnej zabawy i integracji.</h3>
<h3>Szukajcie naszych ulotek pokonajcie trase, zapoznajcie sie z historyjka w formie rymowanki, rozwiazcie hasla.<br />
Na koncu Questu czeka na was skarb - nagroda.<br />
Zadanie finansowane przez Urzad Gminy Wydminy, Fundacje Ochrony Wielkich Jezior Mazurskich w Gizycku,<br />
realizowane w partnerstwie ze Spoldzielnia Socjalna ,, Mixgraf - Studio Reklamy".</h3>

